/* slide show background styles */
.lsq-slide-show-renderer-ctnr{
  z-index: 1;
  position: absolute;
  width: 100%;
  top: 0;
  left: 0;
  height: 100%;
}
.lsq-slide-show-indicator-wrapper{
  height: 36px;
  width: 100%;
  position: absolute;
  background: rgba(0, 0, 0, 0.3);
  bottom: 0;
  left: 0;
  z-index: 10 !important;
  top: calc(100% - 36px);
}
.lsq-slide-show-renderer-ctnr .carousel{
  position: absolute;
  height: 100%;
  width: 100%;
}
.lsq-slide-show-renderer-ctnr .carousel .carousel-inner{
  height: 100% !important;
}
.lsq-slide-show-renderer-ctnr .carousel .carousel-inner .carousel-item{
  height: 100% !important;
}
.lsq-slide-show-indicator-wrapper .indicator-ctnr {
  display: flex;
  justify-content: center;
  height: 100%;
  align-items: center;
}
.lsq-slide-show-indicator-wrapper .indicator-ctnr > .indicator{
  height: 10px;
  width: 10px;
  margin: 0 4px;
  border-radius: 50%;
  background: rgba(153, 153, 153, 1);
  cursor: pointer;
}
.lsq-slide-show-indicator-wrapper .indicator-ctnr > .indicator.active{
  height: 12px;
  width: 24px;
  border-radius: 8px;
  background: rgba(48, 154, 252, 1);
}
.lsq-slide-show-renderer-ctnr .lsq-slide-show-background-overlay {
  height: 100%;
  width: 100%;
}
.lsq-slide-show-renderer-ctnr .lsq-slide-show-background-overlay::before {
    content: '';
    height: 100%;
    width: 100%;
    position: absolute;
    background: var(--lsq-slide-show-overlay-color);
    backdrop-filter: blur(var(--lsq-slide-show-overlay-blur));
    -webkit-backdrop-filter: blur(var(--lsq-slide-show-overlay-blur));
}

/* fix for slide flickering when fade mode  */
.lsq-slide-show-renderer-fade .carousel-inner .carousel-item {
  opacity: 0;
  top: 0;
  left: 0;
  width: 100%;
  display: block;
  position: absolute;
}
.lsq-slide-show-renderer-fade .carousel-inner .carousel-item:first-of-type {
  position: relative;
}
.lsq-slide-show-renderer-fade .carousel-inner .active {
  opacity: 1;
}
